self.onInit = function() {
    if (self.ctx.datasources[0]) {
        let connecotrsTs = [];
        const colors = ['blue', 'green', 'red', 'amber',
            'blue-grey', 'purple', 'light-green',
            'indigo', 'pink', 'yellow',
            'light-blue', 'orange', 'deep-purple',
            'lime', 'teal', 'brown', 'cyan',
            'deep-orange', 'grey'
        ];
        self.ctx.attributeService
            .getEntityTimeseriesLatest(self.ctx
                .datasources[0].entity.id).subscribe(
                data => {
                    connectorsTs = Object.keys(data)
                        .filter(el => el.includes(
                            'ConnectorEventsProduced'
                        ) || el.includes(
                            'ConnectorEventsSent'))
                    if (connectorsTs.length) {
                        self.ctx.defaultSubscription
                            .unsubscribe();
                        let defaultKeysAmount = self.ctx
                            .data.length;
                        connectorsTs.forEach(
                            (connector, index) => {
                                self.ctx
                                    .defaultSubscription
                                    .options
                                    .datasources[0]
                                    .dataKeys.push({
                                        name: connector,
                                        type: 'timeseries',
                                        settings: {},
                                        color: colors[
                                            (index +
                                                defaultKeysAmount
                                            ) %
                                            colors
                                            .length
                                        ]
                                    })
                            })

                    }
                    self.ctx.defaultSubscription
                        .updateDataSubscriptions();
                    initChart();
                    self.ctx.defaultSubscription.options
                        .callbacks.dataLoading =
                        () => {};
                    self.ctx.defaultSubscription
                        .callbacks.onDataUpdated = self
                        .onDataUpdated;
                    self.ctx.defaultSubscription
                        .callbacks.timeWindowUpdated = (
                            subscription, timeWindow
                        ) => {
                            self.ctx.defaultSubscription
                                .options
                                .timeWindowConfig =
                                timeWindow;
                            self.ctx.defaultSubscription
                                .updateTimewindowConfig(
                                    timeWindow);
                            self.ctx.defaultSubscription
                                .update();
                            self.onDataUpdated();
                        }
                }, err => {
                    self.ctx.flot = new TbFlot(self
                        .ctx);
                })
    } else {
        self.ctx.flot = new TbFlot(self.ctx);
    }

    function initChart() {
        if (self.ctx.defaultSubscription.data.length &&
            !self.flot) {
            self.ctx.flot = new TbFlot(self.ctx);
            self.ctx.defaultSubscription
                .onTimewindowChangeFunction =
                timeWindow => {
                    self.ctx.defaultSubscription
                        .options
                        .timeWindowConfig =
                        timeWindow;
                    self.ctx.defaultSubscription
                        .updateTimewindowConfig(
                            timeWindow);
                    self.ctx.defaultSubscription
                        .update();
                    self.onDataUpdated();
                    self.ctx.detectChanges();
                    return timeWindow;
                }
        } else setTimeout(initChart, 500);
    }
}

self.onDataUpdated = function() {
    if (self.ctx.flot && self.ctx.defaultSubscription
        .data.length) {
        self.ctx.flot.update();
    }
}

self.onLatestDataUpdated = function() {
    if (self.ctx.flot) self.ctx.flot.latestDataUpdate();
}

self.onResize = function() {
    if (self.ctx.flot) self.ctx.flot.resize();
}

self.onEditModeChanged = function() {
    if (self.ctx.flot) self.ctx.flot.checkMouseEvents();
}

self.onDestroy = function() {
    if (self.ctx.flot) self.ctx.flot.destroy();
}

self.typeParameters = function() {
    return {
        hasAdditionalLatestDataKeys: true
    };
}

